import React, { Component } from 'react';
import { Grid, Row, Col } from 'react-bootstrap';

class Footer extends Component {

  render(){
    return (
      <footer>
        <Grid>
          <Row>
            <Col xs={3} md={3}>
              + 1 800 WEBSITE
            </Col>
            <Col xs={3} md={3}>
              + 1 800 WEBSITE
            </Col>
            <Col xs={3} md={3}>
              + 1 800 WEBSITE
            </Col>
            <Col xs={3} md={3}>
              + 1 800 WEBSITE
            </Col>
            <Col xs={3} md={3}>
              + 1 800 WEBSITE
            </Col>
          </Row>
        </Grid>
      </footer>
    )
  }
}

export default Footer;
